import './App.scss';
import { Routes, Route } from "react-router-dom";

import Page1 from './pages/Page1';
import Home from './Home';

function App() {
  return (
    <Routes>
      <Route path="/" exact element={<Home />}/>
      <Route path="/gallery" element={<Gallery />}/>
    </Routes>
  );
}

export default App;
